  return (
    <Router>
      <Switch>
        <Route path="/" exact component={Home} />
        <Route path="/recommendations" component={Recommendations} />
        {/* Puedes agregar más rutas aquí */}
      </Switch>
    </Router>
  );
}

export default App;
